import React from 'react';
import './buttonStyle.css';
export const Button = ({ children, type, onClick, disabled }) => (
  <button
    disabled={disabled}
    type={type}
    onClick={onClick}
    className="btn1 text-base m transition duration-300 ease-linear focus:outline-none"
  >
    <span className="span1"> {children}</span>
  </button>
);
